import logo from './logo.svg';
import './App.css';

function App() {
  const landing = {
    width: "100%",
    height: "400px",
    backgroundImage: "url("+process.env.PUBLIC_URL +'/landing.png'+") no-repeat center center"
  };
  return (
    <div style={landing}>
    </div>
  );
}

export default App;
